import React from "react";
import classes from "./FlightInputForm.module.css";
import { Alert, Col, Row, Button, Form, Container } from "react-bootstrap";

const RentalInputForm = (props) => {
  return (
    <Container className={classes.inputForm}>
      <Form className={classes.form_1}>
        <Row className="justify-content-md-center">
          <Col md="auto">
            <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
              <Form.Label>Pick-up location</Form.Label>
              <Form.Control
                type="city"
                autoFocus
                onChange={(event) => {
                  setCityNameFrom(event.target.value);
                }}
              />
              {fetchAirportsFromError.error === true && (
                <Form.Text className={classes.airportSelected}>
                  Couldn't find any airport. Please try again.
                </Form.Text>
              )}
              {isFromCitySelected && (
                <div className={classes.citySelected} muted>
                  {selectedFromCity.iata} | {selectedFromCity.name}
                </div>
              )}

              <div className={classes.btnChoose}>
                <Button
                  size="sm"
                  type="button"
                  onClick={() => {
                    fetchAirportsFromCity(cityNameFrom);
                  }}
                  disabled={cityNameFrom === ""}
                >
                  Choose airport
                </Button>
              </div>
            </Form.Group>
          </Col>
          <Col md="auto">
            <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
              <Form.Label>Travel to</Form.Label>
              <Form.Control
                type="city"
                onChange={(event) => {
                  setCityNameTo(event.target.value);
                }}
              />
              {!toCityIsValid && formIsTouched && (
                <p className={classes.form_text1}>
                  Please provide a valid city name.
                </p>
              )}
              {fetchAirportsToError.error === true && (
                <Form.Text className={classes.airportSelected}>
                  Couldn't find any airport. Please try again.
                </Form.Text>
              )}
              {isToCitySelected && (
                <div className={classes.citySelected} muted>
                  {selectedToCity.iata} | {selectedToCity.name}
                </div>
              )}

              <div className={classes.btnChoose}>
                <Button
                  size="sm"
                  type="button"
                  onClick={() => {
                    fetchAirportsToCity(cityNameTo);
                  }}
                  disabled={cityNameTo === ""}
                >
                  Choose airport
                </Button>
              </div>
            </Form.Group>
          </Col>
          <Col md="auto">
            <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
              <Form.Label>Start of date range</Form.Label>
              <Form.Control
                type="date"
                defaultValue={todaysDate.toString}
                onChange={(event) => {
                  setStartDate(event.target.value);
                }}
              ></Form.Control>
              <Form.Select
                aria-label="Default select example"
                onChange={(event) => {
                  setStartTime(event.target.value);
                }}
              >
                <option value="">Select hour</option>
                <option value="00:00">0:00</option>
                <option value="01:00">1:00</option>
                <option value="02:00">2:00</option>
                <option value="03:00">3:00</option>
                <option value="04:00">4:00</option>
                <option value="05:00">5:00</option>
                <option value="06:00">6:00</option>
                <option value="07:00">7:00</option>
                <option value="08:00">8:00</option>
                <option value="09:00">9:00</option>
                <option value="10:00">10:00</option>
                <option value="11:00">11:00</option>
                <option value="12:00">12:00</option>
                <option value="13:00">13:00</option>
                <option value="14:00">14:00</option>
                <option value="15:00">15:00</option>
                <option value="16:00">16:00</option>
                <option value="17:00">17:00</option>
                <option value="18:00">18:00</option>
                <option value="19:00">19:00</option>
                <option value="20:00">20:00</option>
                <option value="21:00">21:00</option>
                <option value="22:00">22:00</option>
                <option value="23:00">23:00</option>
              </Form.Select>
            </Form.Group>
          </Col>

          <Col md="auto">
            <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
              <Form.Label>End of date range</Form.Label>
              <Form.Control
                type="date"
                defaultValue={todaysDate.toString}
                onChange={(event) => {
                  setEndDate(event.target.value);
                }}
              ></Form.Control>
              <Form.Select
                aria-label="Default select example"
                onChange={(event) => {
                  setEndTime(event.target.value);
                }}
              >
                <option value="">Select hour</option>
                <option value="00:00">0:00</option>
                <option value="01:00">1:00</option>
                <option value="02:00">2:00</option>
                <option value="03:00">3:00</option>
                <option value="04:00">4:00</option>
                <option value="05:00">5:00</option>
                <option value="06:00">6:00</option>
                <option value="07:00">7:00</option>
                <option value="08:00">8:00</option>
                <option value="09:00">9:00</option>
                <option value="10:00">10:00</option>
                <option value="11:00">11:00</option>
                <option value="12:00">12:00</option>
                <option value="13:00">13:00</option>
                <option value="14:00">14:00</option>
                <option value="15:00">15:00</option>
                <option value="16:00">16:00</option>
                <option value="17:00">17:00</option>
                <option value="18:00">18:00</option>
                <option value="19:00">19:00</option>
                <option value="20:00">20:00</option>
                <option value="21:00">21:00</option>
                <option value="22:00">22:00</option>
                <option value="23:00">23:00</option>
              </Form.Select>
            </Form.Group>
          </Col>
          <Col className={classes.btns} xs lg="1">
            <Button
              type="button"
              disabled={
                selectedFromCity === null ||
                selectedToCity === null ||
                startDate === null ||
                endDate === null ||
                startTime === "" ||
                endTime === ""
              }
              onClick={() => {
                fetchFlights();
              }}
            >
              Search
            </Button>
          </Col>
          <Col className={classes.btns} xs lg="1">
            <Button
              variant="success"
              type="button"
              disabled={!isFindFinished}
              onClick={() => {
                try {
                  dispatch(flightsActions.uploadFlights({ flights: flights }));
                  props.showTable(true);
                  setIsFindFinished(false);
                } catch (err) {
                  console.error(err);
                  props.showTable(false);
                }
              }}
            >
              Show flights
            </Button>
          </Col>
        </Row>
      </Form>
      {flightsError.error && (
        <Alert key="danger1" variant="danger">
          Something went wrong. Please try again. Note: The duration of the
          requested period of time must be positive and must not be more than 12
          hours in duration.
        </Alert>
      )}

      {isFlightsEmpty && (
        <Alert key="warning" variant="warning">
          Couldn't find any flight that matches your request. Please try again.
        </Alert>
      )}
    </Container>
  );
};

export default RentalInputForm;
